import React from "react"
import { Navbar, Nav } from "react-bootstrap";
import { Link } from "react-router-dom";

import NavItem from "./SecondaryNav/SecondaryNavItem";
import OffCanvas from "./SecondaryNav/OffCanvas";

const SecondaryNav = () => {
  const datas = [
    {
      "title": "IDR",
      "content": [
        {
          "title": "Indonesian Rupiah (IDR)"
        },
        {
          "title": "US Dollar (USD)"
        }
      ]
    },
    {
      "title": "Account"
    },
  ];

  return (
    <>
      <Nav className="navbar navbar-expand-lg secondary-nav hidden-phone">
        {datas.map((data, i) => {
          return <NavItem data={data} key={i} />
        })}
        <Navbar.Toggle className="toggle-cart" aria-controls={`offcanvasNavbar-expand-lg`}>
          <i className="fa-solid fa-bag-shopping"></i>
          <span> (0)</span>
        </Navbar.Toggle>
      </Nav>
      <Link to="#" className="hidden-desk">
        <i className="fa-solid fa-user"></i>
      </Link>
      <Link to="#" className="hidden-desk">
        <i className="fa-solid fa-magnifying-glass"></i>
      </Link>
      <Link to="#" className="hidden-desk">
      <i className="fa-solid fa-bag-shopping" id="Open Cart"></i>
      </Link>
    </>

  )
}

export default SecondaryNav
